import React from "react";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Navbar from "../components/Navbar";
import logodepartment from "../img/logo/logodepartment.png";
import TextField from "@mui/material/TextField";

function PageLogin() {
  return (
    <div>
      <Navbar />
      <Box
        sx={{
          height: "80vh",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          flexDirection: "column",
        }}
      >
        <Box
          sx={{
            top: "50%",
            left: "50%",
            background: "#6592FD",
            width: "100%",
            maxWidth: 700,
            height: "100%",
            maxHeight: 400,
            display: "flex",
            justifyContent: "center",
            flexDirection: "column",
            textAlign: "center",
            borderRadius: "10px",
            borderStyle: "solid",
          }}
        >
          <Box>
            <Typography
              variant="subtitle1"
              sx={{ color: "#ffffff", fontWeight: "bold", fontSize: "24px" }}
            >
              เข้าสู่ระบบ
            </Typography>
          </Box>
          <Box
            sx={{
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <Box sx={{ display: "flex" }}>
              <Box>
                <img
                  src={logodepartment}
                  alt="img"
                  style={{ width: "200px", height: "200px" }}
                />
              </Box>
            </Box>
            <Box
              sx={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                flexDirection: "column",
              }}
            >
                <Box>
                <TextField
                id="outlined-basic"
                label="Outlined"
                variant="outlined"
              />
                </Box>
              <TextField
                id="outlined-basic"
                label="Outlined"
                variant="outlined"
              />
            </Box>
          </Box>
        </Box>
      </Box>
    </div>
  );
}

export default PageLogin;
